import { Navbar } from "react-bootstrap";
import { BrowserRouter, Route as Switch } from "react-router-dom";

const Routes = () => {
  return <div>
      <BrowserRouter>
        <Navbar />
        <Switch>
            <Route path="/" element={<h1>asd</h1>} />
            <Route path="*" element={<h1>asd2</h1>} />
        </Switch>
      </BrowserRouter>
  </div>;
}

export default Routes;
